import React, { useState } from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import SignInSide from './components/SignInSide/SignInSide.tsx';
import Register from './components/Register.tsx';
import AdminPage from './components/AdminPage.tsx';
import UserPage from './components/UserPage.tsx';
import SubmitBias from './components/SubmitBias.tsx';

const App = () => {
  const [username, setUsername] = useState<string | null>(null);
  return (
    <Router>
      <Routes>
        <Route path="/" element={<SignInSide />} />
        <Route path="/register" element={<Register />} />
        <Route path="/admin" element={<AdminPage />} />
        <Route path="/" element={<Navigate to="/user" replace />} />
        <Route path="/user" element={<UserPage username={username} />} />
        <Route path="/submit" element={<SubmitBias />} />
        <Route path="/search" element={<div className="content">Search Bias Page</div>} />
        <Route path="/editor" element={<div className="content">Editor Page</div>} />
      </Routes>
    </Router>
  );
};

export default App;
